const DeleteProduct = (id) => {

    fetch('https://dummyjson.com/products/1', {
      method: 'DELETE',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(id)
    });
  
    this.items = this.items.filter((item) => item.id !== id  );

}
